$(function () {
  let user = navigator.userAgent
  let ua = user.toLowerCase();
  let isWX = user.match(/MicroMessenger\/[0-9]/i);
  let isIOS = (/iphone|ipad|ipod|ios/i.test(ua));

  function isSafari() {
    return ua.indexOf("applewebkit") > -1 &&
      ua.indexOf("mobile") > -1 &&
      ua.indexOf("safari") > -1 &&
      ua.indexOf("browser") === -1 &&
      ua.indexOf("linux") === -1 &&
      ua.indexOf("android") === -1 &&
      ua.indexOf("chrome") === -1 &&
      ua.indexOf("ios") === -1;
  }

  if (isIOS && !isSafari() && !isWX) {
    $("body").off("click", ".yueyou");
    let html = `<div class="nosafari-popup-box" style="display:none;">
<div class="popup-box-content">
  <img src="data:image/gif;base64,"
      alt="">
  <div class="close">
      <img src="data:image/png;base64,"
          alt="">
  </div>
  <div class="popup-detail-content">
      <p>请使用<img
              src="data:image/png;base64,"
              alt="">
          <span style="color: #468EE7;">Safari</span>浏览器打开链接
      </p>
      <p>安装 <img
              src="data:image/png;base64,"
              alt="">
          <span style="color: #32B768;">3733游戏盒</span>到桌面即可体验游戏
      </p>
      <div class="popup-btn">复制链接</div>
  </div>
</div>
</div>

<style>
.nosafari-popup-box {
  display: block;
  width: 100vw;
  height: 100vh;
  background-color: rgba(0, 0, 0, 0.6);
  position: fixed;
  top: 0;
  left: 0;
  z-index: 999999;
}

.nosafari-popup-box .popup-box-content {
  width: 100%;
  background-color: #fff;
  border-radius: 10px 10px 0 0;
  overflow: hidden;
  position: absolute;
  bottom: 0;
  left: 0;
  z-index: 1;
}

.nosafari-popup-box .popup-box-content img {
  display: block;
  width: 100%;
}

.nosafari-popup-box .popup-box-content .close {
  display: block;
  width: 24px;
  height: 24px;
  position: absolute;
  top: 10px;
  right: 10px;
}

.nosafari-popup-box .popup-box-content .popup-detail-content {
  padding-top: 14px;
  padding-bottom: 20px;
}

.nosafari-popup-box .popup-box-content .popup-detail-content p {
  display: flex;
  align-items: center;
  justify-content: center;
  width: 100%;
  height: 18px;
  font-size: 14px;
  font-weight: 400;
  color: #666666;
  line-height: 18px;
  margin-bottom: 8px;
}

.nosafari-popup-box .popup-box-content .popup-detail-content p img {
  display: block;
  flex: 0 0 20px;
  width: 20px;
  height: 20px;
  margin: 0 4px 0 8px;
}

.nosafari-popup-box .popup-box-content .popup-detail-content p span {
  margin-right: 8px;
}

.nosafari-popup-box .popup-box-content .popup-detail-content .popup-btn {
  display: block;
  width: 66%;
  height: 38px;
  line-height: 38px;
  text-align: center;
  font-size: 13px;
  font-weight: 500;
  color: #FFFFFF;
  margin: 12px auto 0;
  background: linear-gradient(39deg, #32B768 0%, #56D76A 100%);
  border-radius: 26px;
}
</style>`;
    $("body").append(html);
    let href = ""
    $("body").on("click", ".yueyou", function (e) {
      href = $(this).attr("href") || $(this).data("iosurl") || "";
      if (href.indexOf("game.3733.com") > -1) {
        e.preventDefault();
        $(".nosafari-popup-box").show();
      }
    })
    $("body").on("click", ".nosafari-popup-box", function () {
      $(this).hide();
    })
    $("body").on("click", ".nosafari-popup-box .popup-btn", function () {
      let msg = copy(href) ? "复制成功" : "复制失败";
      console.log(msg);
      alert(msg)
    })
  }

  function copy(copyContent) {
    let textareaElement = document.createElement('textarea');
    textareaElement.setAttribute('readonly', 'readonly'); // 防止弹出输入编辑
    textareaElement.value = copyContent; //将需要拷贝的内容设置到textarea元素中。
    document.body.appendChild(textareaElement);
    textareaElement.select(); //选中textarea元素，以备调用系统copy函数复制其中的内容。
    let isSuccess = document.execCommand('copy'); //调用操作系统复制api，返回是否复制成功。true或false！
    document.body.removeChild(textareaElement);
    return isSuccess;
  }
})